import React from "react";
import { useState } from 'react';
import { Link } from 'react-router-dom';
import { makeStyles } from "@material-ui/core/styles";
import { FaLinkedin } from 'react-icons/fa';
import Button2 from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import SendIcon from '@mui/icons-material/Send';
import { styled } from '@mui/material/styles';
import flower from './fwr.svg';
import { TypeAnimation } from 'react-type-animation';
import { red } from '@mui/material/colors';
import { AppBar, Toolbar, Typography, Button, Grid, Paper } from "@material-ui/core";


const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  appBar: {
    backgroundColor: theme.palette.background.paper,
    borderBottom: "1px solid pink", 
    boxShadow: "none",
    fontFamily: 'Palanquin',
    fontSize: 150,
  },
  links:{
    fontSize: 12,
  },
  title: {
    flexGrow: 1,
    paddingLeft: '50%',
    fontWeight: "bold",
    color: "black",
    fontFamily: 'Palanquin',

  },
  summarySection: {
    marginTop: 100,
    marginLeft: 50,
    padding: theme.spacing(3),
    fontFamily: 'Gallient',
    fontSize: 120,
    fontWeight: 20,
    animation: "type 4s steps(60, end)",

  },
  top: {
    marginTop: -60,
    marginLeft: 50,
    padding: theme.spacing(3),
    fontFamily: 'Gallient',
    fontSize: 20,
    fontWeight: 20,
    animation: "type 4s steps(60, end)",

  },
  comment: {
    marginTop: -550,
    marginLeft: 700,
    padding: theme.spacing(3),
    fontFamily: 'Gallient',
    fontSize: 30,
    fontWeight: 20,

  },
  interactiveArt: {
    marginTop: -70,
    width: 100,
    height: '100%',
  },
  linkedinButton: {
    marginTop: -3,

  },
}));

const Homepage = () => {
  const classes = useStyles();

  const [linkedinUrl] = useState('https://www.linkedin.com/in/micatonge');

  const handleLinkedinClick = () => {
    window.open(linkedinUrl, '_blank');
  };

  window.onload = function() {
    window.setTimeout(fadeout, 8000); //8 seconds
  }

  function fadeout() {
    document.getElementById('fadeout').style.opacity = '0';
  }
  const ColorButton = styled(Button)(({ theme }) => ({
    color: theme.palette.getContrastText(red[400]),
    backgroundColor: red[400],
    '&:hover': {
      backgroundColor: red[500],
    },
  }));

  return (
    <div className={classes.root}>
      <AppBar position="static" className={classes.appBar}>
        <Toolbar className={classes.appBar} >
          <Button className={classes.links} component={Link} to="/">Home</Button>
          <Button className={classes.links} component={Link} to="/about">About Me</Button>
          <Button className={classes.links} component={Link} to="/projects">Projects</Button>
          <Button className={classes.links} component={Link} to="/resume">Resume</Button>
          <Button className={classes.links} component={Link} to="/contact">Contact Me</Button>
          <Button className={classes.linkedinButton} onClick={handleLinkedinClick}>
            <FaLinkedin size={20} />
          </Button>
          {/* <Typography variant="h6" className={classes.title}>
            Mica Tonge
          </Typography> */}
        </Toolbar>
      </AppBar>
      <Grid container>
        <Grid item xs={12} md={6}>
            <Typography  className={classes.summarySection} variant="h6">Mica  Tonge</Typography>
            <Typography  className={classes.top} variant="h6">based in new york. open to relocation âœ»</Typography>
            {/* <Typography id="fadeout" className={classes.comment} variant="h1"> you can find me coding . . .</Typography> */}
            <Stack direction="row" spacing={2}>
      <ColorButton variant="contained">Contained</ColorButton>
      <Button variant="contained" endIcon={<SendIcon />}>
  Send
</Button>
      <Button variant="contained" href="#contained-buttons">
        Link
      </Button>
    </Stack>
        </Grid>
        {/* <Grid item xs={2} md={3} className={classes.interactiveArt}>
        <img src={flower} alt="logo" />
        </Grid> */}
      </Grid>
    </div>
  );
};

export default Homepage;
